import React,{useState} from "react";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Axios from 'axios'

function Doctorx() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [name, setName] = useState("");
  const [doctorid, setDoctorid] = useState("");
  const [mobilenum,setMobilenum] = useState("");
  const [address, setAddress] = useState("");
  const [specialisation, setSpecialisation] = useState("");
  const [experience, setExperience] = useState(0);

  const addToList = () => {
    Axios.post("http://localhost:5000/signup-patient", {
      email: email,
      password: password,
      name: name,
      doctorid: doctorid,
      mobilenum: mobilenum,
      address: address,
      specialisation: specialisation,
      experience: experience
    });
  };
  return (
    <>
      <h1 style={{ fontFamily: "sans-serif" ,textAlign:"center" }}>Doctor SignUp!!</h1>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "50vh",
          width: "140vh 140vh",
          border: "1px solid gray", 
          margin: "100px 240px 100px 240px", 
        }}
      >
        <Form onClick={addToList}>
          <Row>
          <Form.Group className="mb-3" controlId="emailx" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>Email</Form.Label>
            <Form.Control
              type="email"
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="passwordx" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>
              Password
            </Form.Label>
            <Form.Control
              type="password"
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>
          <Form.Group className="mb-3" controlId="namex" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>Name</Form.Label>
            <Form.Control
              type="text"
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="doctoridx" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>
              doctorId
            </Form.Label>
            <Form.Control
              type="text"
              onChange={(e) => {
                set(e.target.value);
              }}
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>
          </Row>
          <Row>
          <Form.Group className="mb-3" controlId="mobilenumx" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>
              mobileNum
            </Form.Label>
            <Form.Control
              type="text"
              onChange={(e) => {
                setMobilenum(e.target.value);
              }}
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="addressx" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>
              address
            </Form.Label>
            <Form.Control
              type="text"
              onChange={(e) => {
                setAddress(e.target.value);
              }}
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>

   

          <Form.Group className="mb-3" controlId="specialisationx" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>
              specialisation
            </Form.Label>
            <Form.Control
              type="text"
              onChange={(e) => {
                setSpecialisation(e.target.value);
              }}
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>
          <Form.Group className="mb-3" controlId="experiencex" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>
              experience
            </Form.Label>
            <Form.Control
              type="number"
              onChange={(e) => {
                setExperience(e.target.value);
              }}
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>
          </Row>

          <div
            style={{
              display: "flex",
              justifyContent: "space-between",
              marginTop: "20px", 
            }}
          >
            <Button
              variant="dark"
              type="submit"
              size="lg"
              style={{ fontFamily: "sans-serif" }}
            >
              SignUp
            </Button>
            <Button
              variant="dark"
              type="submit"
              size="lg"
              style={{ fontFamily: "sans-serif" }}
            >
              Login
            </Button>
          </div>
        </Form>
      </div>
    </>
  );
}

export default Doctorx;
